    [Fact]
    public async Task ShouldCreateWorkWeChatGroup()
    {
        await CreateWorkWeChatCorpAndApplication();

        var response = await CreateWorkWeChatGroup(new CreateWorkWeChatGroupCommand
        {
            AppId = AppId,
            Name = "PostBoy Test",
            UserList = _testUsers
        });
        
        response.ChatId.ShouldNotBeEmpty();
    }
    
