        await _client.PostAsJsonAsync("api/message/send", new SendMessageCommand
        {
            WorkWeChatAppNotification = new SendWorkWeChatAppNotificationDto
            {
                AppId = AppId,
                ChatId = chatId,
                ToUsers = _testUsers,
                Text = new SendWorkWeChatTextNotificationDto
