    private async Task CreateWorkWeChatCorpAndApplication()
    {
        var repo = _factory.Services.GetRequiredService<IRepository>();
        var unitOfWork = _factory.Services.GetRequiredService<IUnitOfWork>();

        var corpId = Guid.NewGuid();
        
        await repo.InsertAsync(new WorkWeChatCorp
        {
            Id = corpId,
            CorpId = "ww7ba014f121ddabef",
            CorpName = "人类问题研究中心"
        });
        await repo.InsertAsync(new WorkWeChatCorpApplication
        {
            WorkWeChatCorpId = corpId,
            AppId = AppId,
            Name = "PostBoy",
            AgentId = 1000013,
            Secret = "5nNH6F5ImMNLOm3p-Q4BdERsL8JA4EsaNBGurivoGOo"
        });
        
        await unitOfWork.SaveChangesAsync();
    }

    private async Task<string> CreateWorkWeChatGroupIfRequire(bool create)
    {
        var chatId = string.Empty;

        if (!create) return chatId;
        
        var response = await CreateWorkWeChatGroup(new CreateWorkWeChatGroupCommand
        {
            AppId = AppId,
            ChatId = ChatId,
            Name = "PostBoy Test",
            UserList = _testUsers
        });

        chatId = response.ChatId;

        return chatId ?? ChatId;
    }

    private async Task<CreateWorkWeChatGroupResponseDto> CreateWorkWeChatGroup(CreateWorkWeChatGroupCommand command)
    {
        var response = await _client.PostAsJsonAsync("api/wechat/work/group/create", command);

        return await response.Content.ReadAsAsync<CreateWorkWeChatGroupResponseDto>();
    }

    public void Dispose()
    {
        _factory.Services.GetRequiredService<InMemoryDbContext>().Database.EnsureDeleted();
    }
